import React from 'react';
import Alert from 'react-bootstrap/Alert';
import { Fade } from 'react-bootstrap';

const Alerts = ({ alert }) => {
  console.log(Fade);
  return (
    <Alert
      show={alert.show}
      variant={alert.type}
      dismissible
      transition={Fade}
      onClose={() => (alert.show = false)}
    >
      {alert.msg}
    </Alert>
  );
};

export default Alerts;
